import styled from "styled-components";

export const Back = styled.div`
  z-index: 1;
  //height: 100vh;
`;

export const Front = styled.div`
  z-index: 2;
  dipslay: flex;
  justify-content: center
  font-size: 48;
  font-family: "Oswald", sans-serif;
  font-weight: bold;
  color: #096192;
  text-transform: uppercase;
`;
